import React, { Component } from "react";
import "./main.css";
import { BrowserRouter, Route, Link } from "react-router-dom";
import temp1pic from "./temp1.png";
import temp2pic from "./temp2.jpg";
import temp3pic from "./temp3.jpg";
import temp4pic from "./temp4.jpg";
export default class SelectT extends Component {
  render() {
    return (
      <div>
        <h1 className="Class1"> Step 1</h1>
        <div>
          <a className="App-logo" href="/survey/temp1">
            <img src={temp1pic} />
          </a>

          <a href="/survey/temp2">
            <img className="App-logo" src={temp2pic} />
          </a>
        </div>
        <div>
          <a href="/survey/temp3">
            <img className="App-logo" src={temp3pic} />
          </a>
          <a href="/survey/temp4">
            <img className="App-logo" src={temp4pic} />
          </a>
        </div>
      </div>
    );
  }
}
